const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Part = (props) => {
  return (
    <p>{props.object.name} {props.object.exercises}</p>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part object={props.firstPart} />
      <Part object={props.secondPart} />
      <Part object={props.thirdPart} />
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>Number of exercises {props.object1.exercises + props.object2.exercises + props.object3.exercises}</p>
    </div>
  )
}

